import React from 'react'
import { course } from '../App'

const Header = ({ text }) => {
  return (
    <h1>{text}</h1>
  )
}

const Part = ({ course }) => {
  return (
    <p>{course.parts[0].name} {course.parts[0].exercises}</p>
  )
}

const Content = ({ course }) => {

  return (
    <>
      <Part course={course} />
    </>
  )
}

const Course = ({ course }) => {
  console.log(course)
  return (
    <>
      <Header course={course} text='Half Stack application development'/>
      <Content course={course} />
    </>
  )
}

export default Course
